@GretaThunberg I participated in a phone-meeting with Greta, Bo and others in June 2018. 
After a while Greta concluded: "You are not radical enough. I have to do something myself." and then she hung up. 
She went on to do her thing, her way. For that I am very grateful. #FridaysForFuture
